import React, {useState} from 'react';
import axios from 'axios';
import { Button } from 'semantic-ui-react';

function SearchBox ()  {

    const [plant, setPlant] = useState([]);



    const getPlant = () => {
        //This API enables cross-origin requests to anywhere
      axios.get('https://cors-anywhere.herokuapp.com/https://trefle.io/api/v1/species/search?q=coconut&token=wfOfrblXggceP_xcDAcmmxDOO4XmIyJY1KgXKK0_utA')
        .then(response => {
            setPlant(response.data.data);
            console.log(response);
        });

      };

      return (
        <div className="App">  
          <Button className="green" onClick={getPlant}>Fetch Plants</Button>

          <div className="list">
            {plant.map((value, index) => {
              return (<li plant={value} key={index} > {value.common_name} <img src={value.image_url} alt="tryin"></img></li>)
            })}
          </div>

        </div>
      );

  }
  export default SearchBox;
